import axiosInstance from '../utils/axiosConfig'
import { useNavigate } from "react-router-dom";
import { ACCOUNT_API_URL } from '../constant/apiUrls';

const headers = {
  'Content-Type': 'application/json'
}

// Send credentials to the API
export const loginWithOuth = (queryParams) => {
  return axiosInstance.post(ACCOUNT_API_URL.login, queryParams)
}

export const EmployerSignup = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.employerSignup, body)
}

export const CompanyLogo = (body, id) => {
  return axiosInstance.post(`${ACCOUNT_API_URL.companyLogo}`, body)
}

export const GovtDoc = (body, id) => {
  return axiosInstance.post(`${ACCOUNT_API_URL.govtDoc}`, body)
}
export const GovtDocDelete = (id) => {
  return axiosInstance.delete(`${ACCOUNT_API_URL.govDocDelete}/${id}`)
}


export const Employersubscribe = () => {
  return axiosInstance.get(ACCOUNT_API_URL.employerSubscription)
}
export const EmployersubscribeVerify = () => {
  return axiosInstance.get(ACCOUNT_API_URL.employerPaymentVerify)
}

export const EmployerPaymentUpdate = (params, body) => {
  return axiosInstance.post(ACCOUNT_API_URL.employerPayment, { payment_details: [body] }, { params, })
}

export const EmployerProfile = () => {
  return axiosInstance.get(ACCOUNT_API_URL.employerProfile)
}
export const InvoiceList = () => {
  return axiosInstance.get(ACCOUNT_API_URL.employerInvoice)
}

export const sendOtp = (queryParams) => {
  return axiosInstance.post(ACCOUNT_API_URL.sendOtp, queryParams)
}

export const verifyOtp = (queryParams) => {
  return axiosInstance.post(ACCOUNT_API_URL.verifyOtp, queryParams)
}
export const employeeProfile = () => {
  return axiosInstance.get(ACCOUNT_API_URL.employeeProfile)
}
export const employeeProfilesUpdate = (body) => {
  // console.log("QURRY", body);
  return axiosInstance.post(ACCOUNT_API_URL.employeeProfileUpdate, body)
}
export const employeeBankUpdate = (body) => {
  console.log("QURRY", body);
  return axiosInstance.post(ACCOUNT_API_URL.employeeBankUpdate, body)
}
export const employeePhotosUpdate = (body, id) => {
  return axiosInstance.post(`${ACCOUNT_API_URL.employeePhotoUpdate}/${id}`, body)
}

export const EmployeeSignup = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.employeeSignup, body)
}

export const EmployeeProfile = (body, id) => {
  return axiosInstance.post(`${ACCOUNT_API_URL.employeeProfile}/${id}`, body)
}

export const EmployeeSubscribe = () => {
  return axiosInstance.get(ACCOUNT_API_URL.employeeSubscription)
}
export const EmployeePaymentUpdate = (params, body) => {
  return axiosInstance.post(ACCOUNT_API_URL.employePayment, { payment_details: [body] }, { params, })
}
export const EmployerSubscriptionCreate = () => {
  return axiosInstance.get(ACCOUNT_API_URL.employerSubscription)
}
export const EmployerSubscriptionVerify = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.employerSubscriptionVerify, body)
}
export const EmployeeSubscriptionCreate = () => {
  return axiosInstance.get(ACCOUNT_API_URL.employeeSubscription)
}
export const EmployeeSubscriptionVerify = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.employeeSubscriptionVerify, body)
}

export const EmployeeTabData = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.employeeTabData, body)
}
export const EmployeeSubscriptionView = () => {
  return axiosInstance.get(ACCOUNT_API_URL.employeeSubscriptionView)
}
export const getEmployeeBankDetails = () => {
  return axiosInstance.get(ACCOUNT_API_URL.getEmployeeBankDetails)
}

export const EmployerSubscriptionView = () => {
  return axiosInstance.get(ACCOUNT_API_URL.employerSubscriptionView)
}
export const JobAplicationCreate = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.jobApplicationCreate, body)
}

export const CertificationAplicationCreate = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.certificationApplicationCreate, body)
}


export const EmployeeSubscriptionRenewal = () => {
  return axiosInstance.get(ACCOUNT_API_URL.employeeRenewal)
}
export const EmployerSubscriptionRenewal = () => {
  return axiosInstance.get(ACCOUNT_API_URL.employerRenewal)
}

export const sendOtpEmployer = (queryParams) => {
  return axiosInstance.post(ACCOUNT_API_URL.sendOtpEmployer, queryParams)
}

export const verifyOtpEmployer = (queryParams) => {
  return axiosInstance.post(ACCOUNT_API_URL.verifyOtpEmployer, queryParams)
}
export const RequestsPassword = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.requestPassword, body)
}
export const NewPassword = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.setPassword, body)
}

export const sendEmailOtp = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.sendEmailOtp, body)
}
export const verifyEmailOtp = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.verifyEmailOtp, body)
}
export const NotificationsList = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.notificationsList, body)
}
export const EmployerNotificationsList = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.employerNotificationsList, body)
}

export const rejectionPayment = () => {
  return axiosInstance.post(ACCOUNT_API_URL.rejectionPayment)
}

export const rejectionPaymentCapture = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.rejectionPaymentCapture,body)
}
export const employeeComplaint = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.employeeComplaint, body)
}
export const employerComplaint = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.employerComplaint, body)
}
export const EmployerSubscriptionTrail = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.employerSubscriptionTrail, body)
}
export const EmployeeSubscriptionTrail = (body) => {
  return axiosInstance.post(ACCOUNT_API_URL.employeeSubscriptionTrail, body)
}
